// src/components/Navbar.js

import React from 'react';
import { Link } from 'react-router-dom'; // Assuming react-router-dom is used for navigation
import { supabase } from '../supabaseClient'; // Adjust path if needed

const Navbar = ({ session }) => { // Session prop is used to conditionally show logout
    const handleLogout = async () => {
        await supabase.auth.signOut();
    };

    return (
        <nav className="navbar-container"> {/* Changed class name for clarity */}
            <div className="navbar-left">
                {/* Placeholder for your logo image */}
                {/* Make sure the path to your logo is correct */}
                <img src="/images/my-trading-portal-logo.png" alt="Paper Trading Logo" className="navbar-logo" /> 

                <ul className="nav-links">
                    <li><Link to="/dashboard">Dashboard</Link></li>
                    <li><Link to="/watchlist">Watchlist</Link></li>
                    <li><Link to="/account">Account</Link></li>
                    <li><Link to="/legal">Legal</Link></li> {/* Added Legal link as per your screenshot */}
                </ul>
            </div>

            <div className="navbar-right">
                {session && session.user && session.user.email && ( // Conditionally display welcome message
                    <span className="welcome-message">Welcome, {session.user.email}!</span>
                )}
                {session && (
                    <li> {/* This 'li' needs to be outside the 'ul' from before */}
                        <button onClick={handleLogout} className="logout-button">Logout</button>
                    </li>
                )}
            </div>
        </nav>
    );
};

export default Navbar;
